#데이터 분석 시 부정적인 영향을 미치는 현상을 말합니다.
#1. 후진 소거법(추천) / 2. 전진 선택법 / 3. 왕복 소거법 / 4. 올인 / 5. 점수 비교법 -> 사이킷런이 자동 처리

