import numpy as np
import pandas as pd
import matplotlib.pyplot as plt


#importing the dataset
dataset = pd.read_csv('/content/drive/MyDrive/유데미/machine_learning/section6_회귀/2_다중선형회귀/50_Startups.csv')
#독립 변수 / 종속 변수 = 마지막 -> 예측하려는 값
X = dataset.iloc[:, :-1].values #values = 데이터를 넘파이 배열로 추출
y = dataset.iloc[:, -1].values
print(X.shape)
print(y.shape)
print()


#encoding categorical data
from sklearn.impute import SimpleImputer
imputer = SimpleImputer(missing_values=np.nan, strategy='mean') #missing_values=np.nan 모든 결측값을 대체한다. / strategy='mean' 평균으로 대체한다.
imputer.fit(X[:,:2]) #숫자값을 가지는 열만 전달해야 한다. 어디에 결측값이 있을지 모르니 모든 숫자형 열 선택
X[:,:2] = imputer.transform(X[:,:2])
print(X[3])
print()

print(X[:5])
print()
from sklearn.compose import ColumnTransformer
from sklearn.preprocessing import OneHotEncoder
ct = ColumnTransformer(transformers=[('encoder', OneHotEncoder(),[3] )], remainder='passthrough')
X = ct.fit_transform(X) ##ColumnTransformer에는 fit_transform 메서드가 있어서 한 번에 처리할 수 있다.
#feature scaling은 안 한다 -> 다중 선형 회귀 방정식에서는 계수가 독립 변수 -> 각 특성에 곱해져 있기 때문에
#해당 데이터 세트에 선형 관계가 없다면 다중 선형 회귀를 안 하면 된다.
print(X[:5])
print()

#splitting the dataset into the training set and test set
from sklearn.model_selection import train_test_split
X_train, X_test, y_train, y_test = train_test_split(X, y, test_size = 0.2, random_state=0) #권장 훈련 세트 80%, 테스트 세트 20%


#training the multiple linear regression model on the training set
from sklearn.linear_model import LinearRegression
lr = LinearRegression()
lr.fit(X_train, y_train)


#predicting the test set results
y_pred = lr.predict(X_test)
print(y_pred)
print()

np.set_printoptions(precision=2) #소수점 둘째 자리까지 표시
print(np.concatenate((y_pred.reshape(len(y_pred), 1), y_test.reshape(len(y_test), 1)), 1))
#y_pred 벡터의 형태를 y_pred 길이 만큼의 행을 가진 배열로 바꾸겠다. 열은 1개

#np.concatenate = 두 백터 또는 배열을 수직이나 수평 방향으로 연결해 주는 넘파이 함수
#첫 번째 인자 = 연결하고자 하는 배열 또는 벡터의 튜플
#두 번째 인자 = axis(축) 0 : 수직 방향 / 1 : 수평 방향

#reshape() = 벡터나 배열의 모양을 변경 / 수평에서 수직 = (매개변수로 요소의 개수, 1)


